import * as React from "react";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button } from "@mui/material";
import HomePageCardImage from "./HomePageCardImage";

export default function HomePageCard({ title, body, img, cardLink }) {
  return (
    <Card sx={{ width: "270px", height: "365px" }} elevation={1}>
      <CardContent style={{ padding: 0 }}>
        <HomePageCardImage image={img} />

        <Typography
          variant="subtitle1"
          style={{
            position: "relative",
            maxWidth: "240px",
            height: "21px",
            marginLeft: "15px",
            marginTop: "10px",
            lineHeight: "21px",
            fontSize: "18px",
          }}
        >
          {title}
        </Typography>

        <Typography
          variant="body1"
          style={{
            position: "relative",
            maxWidth: "240px",
            height: "17px",
            marginLeft: "15px",
            marginTop: "5px",
            lineHeight: "17px",
            fontSize: "14px",
          }}
        >
          {body}
        </Typography>
      </CardContent>

      <CardActions>
        <Button
          disableRipple={true}
          href={cardLink}
          style={{
            position: "absolute",
            background: 0,
            textTransform: "none",
            height: "100px",
            width: "270px",
            marginTop: "-40px",
            marginLeft: "-10px",
          }}
        >
          <Typography
            style={{
              textDecoration: "underline",
              lineHeight: "17px",
              fontSize: "16px",
              marginTop: "55px",
              marginLeft: "-190px",
            }}
            color="secondary"
          >
            Incele
          </Typography>
        </Button>
      </CardActions>
    </Card>
  );
}
